import React from 'react';

const Restaurant =({ restaurant })=>{
    return(
        <div className="item">
            <img className="ui image" src={restaurant.icon} />
            <div className="content">
                <div className="header">
                {restaurant.name}
                </div>
                <div class="meta">
                    <span>{restaurant.formatted_address}</span>
                </div>
                <div class="meta">
                    <span><label>Opening Hours: </label>{restaurant.open_now?'Open':'Closed'}</span>
                </div>
            </div>
        </div>
    );
}

export default Restaurant;
